async def handle_query(update, context):
    q = update.callback_query; await q.answer()
    uid, uname = q.from_user.id, q.from_user.username
    v = get_user_vault(uid, uname)
    
    if "SET_" in q.data:
        val = int(q.data.split("_")[1]); context.user_data['payout'] = val
        await q.edit_message_text(f"‚úÖ <b>CAPACITY ARMED: ${val}</b>")

    elif "INT_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        payout = context.user_data.get('payout', 100)
        s_yes, s_no = float(target['y_pr']) * payout, float(target['n_pr']) * payout
        profit = payout - (s_yes + s_no)
        context.user_data['active_arb'] = {'idx': idx, 's_yes': s_yes, 's_no': s_no, 'profit': profit}
        
        desc = (f"‚öñÔ∏è <b>STRIKE ANALYSIS</b>\n{SEP}\n"
                f"üü¢ <b>YES STAKE:</b> <code>${s_yes:.2f}</code>\n"
                f"üî¥ <b>NO STAKE:</b> <code>${s_no:.2f}</code>\n"
                f"üìä <b>NET PROFIT:</b> <code>${profit:.2f}</code>\n{SEP}")
        await q.edit_message_text(desc, reply_markup=InlineKeyboardMarkup([[InlineKeyboardButton("üî• INITIATE STRIKE", callback_data=f"STP1_{idx}")]]), parse_mode='HTML')

    elif "STP1_" in q.data:
        arb = context.user_data['active_arb']
        await q.edit_message_text(f"‚ö°Ô∏è <b>STRIKE ARMED: ${arb['s_yes'] + arb['s_no']:.2f}</b>", 
                                  reply_markup=InlineKeyboardMarkup([[InlineKeyboardButton("üöÄ CONFIRM EXECUTION", callback_data=f"EXE_{arb['idx']}")]]))

    elif "EXE_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        arb = context.user_data['active_arb']
        m_proc = await context.bot.send_message(q.message.chat_id, "üëÅ‚Äçüó® <b>EXECUTING ATOMIC SWAPS...</b>", parse_mode='HTML')
        try:
            client = ClobClient(host="https://clob.polymarket.com", key=v.key.hex(), chain_id=137, signature_type=0, funder=v.address)
            client.set_api_creds(client.create_or_derive_api_creds())
            for tid, stake in [(target['y_tid'], arb['s_yes']), (target['n_tid'], arb['s_no'])]:
                args = MarketOrderArgs(token_id=str(tid), amount=stake, side=BUY, price=0.999)
                signed = await asyncio.to_thread(client.create_order, args)
                await asyncio.to_thread(client.post_order, signed, OrderType.FOK)
            STRIKE_LOG[str(target['y_tid'])] = {"q": target['q'], "stake": arb['s_yes'], "price": target['y_pr'], "chat_id": q.message.chat_id}
            await m_proc.edit_text(f"üöÄ <b>STRIKE SUCCESSFUL</b>\n{SEP}\n<i>Orders broadcasted to CLOB.</i>", parse_mode='HTML')
        except Exception as e:
            await m_proc.edit_text(f"‚ö†Ô∏è <b>HARD ERROR:</b> <code>{str(e)[:45]}</code>", parse_mode='HTML')

